import React, { Component } from 'react';
import Url from './url';
import GetOne from './getone';
import { BrowserRouter, Route, Redirect } from 'react-router-dom';

class App extends Component {
  render() {
    return (
      <div>
        <BrowserRouter>
        <div>
              <Route
                path="/"
                exact
                component={Url}
              />
              <Route
                path="/get/:id"
                exact
                strict
                component={GetOne}
              />
              <Redirect to="/" />
        </div>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
